import React from 'react'
import "./HeroStyles.css";
function Hero(props){
  return (
    <div className="hero-text">
      <h1 style={{color:'#632020'}}>Turning ideas into reality....</h1>
      <h2 style={{backgroundColor: '#4c2121', color: 'white', textAlign: 'left', width:335}}>Grow your business with us</h2>
       <img alt="HeroImg" src="https://thumbs.dreamstime.com/z/software-development-word-cloud-concept-grey-background-88535408.jpg?w=992"/>
      <div className="hero-text">
        <h1>{props.title}</h1>
        <p>{props.title}</p>
        
        </div>    
    </div>
    )
}

export default Hero;
